syntax = "proto3";
option csharp_namespace = "Common.Protobuf";

option java_package = "catgirl.kirara.moe";

import "ChannelerSlabChallenge.proto";
import "ChannelerSlabOneoffDungeon.proto";

// Name: AOLLDEBHDJM
message ChannelerSlabChallengeStage {
    uint32 open_time = 15;
    uint32 stage_id = 4;
    bool is_open = 9;
